import React from 'react';

const SliderRange = props => {
    return (
        <div className="form-group">

            <input 
                className="form-control" 
                id={props.name} 
                name={props.name} 
                type={props.inputtype} 
                required={props.required}
                {...props}
            />

        </div>
    )
}
export default SliderRange;
